import "./Section3.scss";
import { useState } from "react";
import {
  MatchText,
  SearchProvider,
  SearchContext,
  SearchEventContext,
} from 'react-ctrl-f';

export default function Section3() {
  const [t, setT] = useState({
    text:
      'Biz məqsədyönlü tədqiqatçılar üçün nəzərdə tutulan və onların yalnız xüsusi dəvət əsasında qəbul edilməsinə dayanan Cəmiyyətik. Elə bu səbəbdən də, burada əslində "nə" sualı "kim" sualı kimi qəbul edilir. Bizim üzvlərimiz bir-birinə meydan oxuyan, bir-birini cəsarətləndirən, ideyalarının formalaşdırılmasında və test edilməsində bir-birinə dəstək olan təsisçilər, mütəfəkkirlər və sahə mütəxəssislərindən ibarətdir. Biz yaxşı fikirlərin çox nadir hallarda təkbaşına ortaya çıxdığını düşünürük. Biz yeni təklif və fikirlərin inkişaf etdirilməsini dəstəkləyən təhlükəsiz zona və antiinkubatoruq.'
  });
  return (
  <SearchProvider>
    <div className="Section3">
      <div className="div11">
        <div className="center">
          <div className="left">Biz kimik?</div>
          <MatchText id='match-1'><div className="right">{t.text}</div></MatchText>
        </div>
      </div>
    </div>
    </SearchProvider>
  );
}
